import React from 'react';
import ReactDOM from 'react-dom';
import getFirestoneApp from './firebase/config';
import './index.css';
import App from './App';

getFirestoneApp();

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
